  true,\n\t\"url\": null,\n\t\"notes\": \"Healthy Access Locator map can be used to
  view schools that have received a Healthier US Schools Challenge Award (HUSSC).
  To get started, click on Search Awards and enter your search criteria. When the
  information displays on the map, you can click a star for additional details or
  see a summary of your results below the map. You can also use the Data Layers feature
  to display different data layers on obesity and diabetes prevalence, SNAP Participation
  Rates, and SNAP Outreach Plans by states. (HUSSC Awards as of May 30, 2013).\",\n\t\"license_title\":
